CREATE PROCEDURE pokemon_abilities (IN var1 varchar(80)) 
BEGIN 
SELECT pokemon.pok_id, pokemon.pok_name, abilities.ability_name
FROM pokemon INNER JOIN pokemon_abilities ON pokemon.pok_id = pokemon_abilities.pok_id INNER JOIN abilities ON pokemon_abilities.ability_id = abilities.ability_id
WHERE pokemon.pok_name = var1;
END $$
