DELIMITER $$
CREATE PROCEDURE pokemon_base_stats (IN var1 varchar(80))
BEGIN 
SELECT base_stats.b_atk, base_stats.b_def, base_stats.b_hp, base_stats.b_sp_atk, base_stats.b_sp_def, base_stats.b_speed
FROM pokemon INNER JOIN base_stats ON pokemon.pok_id = base_stats.pok_id
WHERE pokmon.name = var1;
END $$ 
DELIMITER $ 

DELIMITER $$
CREATE PROCEDURE pokemon_moves (IN var1 varchar(80)) 
BEGIN 
SELECT pokemon.pok_id, pokemon.pok_name, moves.move_name
FROM pokemon INNER JOIN pokemon_moves ON pokemon.pok_id = pokemon_moves.pok_id
INNER JOIN moves ON pokemon_moves.move_id = moves.move_id 
WHERE pokemon.name = var1; 
END $$ 
